Naughty Bookworms - Jessie Andrews

Actors: Jessie Andrews, Dale Dabone

Release Date: November 12, 2010

Who: College Girl, Student,

Where: Chair, Classroom, Desk,

Jessie comes to Prof. Dabone's class and when she goes to introduce herself, he looks strangely familiar. She can't place him at first, but then remembers he was at the club she was at, and before she could meet him he had left. She wanted to get to know him that night, but there is no time like the present. Might as well make up for lost time.
